import ReactPlayer from "react-player";

export const Buttons = (props) => {
  const { content } = props;

  console.log(props);
  return (
    <div className="buttonContainer">
      {content.map((item) => (
        <div className="buttonSpace">
            <ReactPlayer url={item.embed} />
          <a className="click" href={item.embed}>
            <button id="btn">{item.title}</button>
          </a>
        </div>
      ))}
    </div>
  );
};

export default Buttons;
